@events.register(events.NewMessage(outgoing=True, pattern=r"\.getbanned")) 
async def getbaed(event):
    try:
        users = await Client.get_participants(event.chat_id, filter=ChannelParticipantsBanned)
    except Exception as e:
        return await event.edit(f"ERROR - {str(e)}")
    if len(users) > 0:
        msg = f"‚úì List of banned member in this group !!\n‚úì Total : {len(users)}\n\n"
        for user in users:
            if not user.deleted:
                msg += f"üõ° [{user.first_name}]({user.id})\n"
            else:
                msg += "‚ò†Ô∏è  Deleted Account\n"
        await event.edit(msg)
    else:
        await event.edit("No Banned Users !!")


